# -----------------------------------------------------------------------
# main function - entry point
# -----------------------------------------------------------------------

main:
	# Construct interrupt mask
	li	$t4, 0
	or	$t4, $t4, BONK_INT_MASK			# request bonk
	or	$t4, $t4, REQUEST_PUZZLE_INT_MASK	# puzzle interrupt bit
	or	$t4, $t4, 1				# global enable
	mtc0	$t4, $12
	
	# Fill in your code here
	
	# figure out which side we're on
	lw	$t0, BOT_X
	bge	$t0, 100, infinite	# only test on one bot
	
	# testing puzzle generation and solving time
	# note: marker doesn't have to start at A, and may increase by more than one
	# given solution solving cycles on first 10: 137954 135267 160251 146216 122622 133782 127169 135742 142828 135172
	lw	$s0, TIMER
	la	$t0, puzzle
        sw	$t0, REQUEST_PUZZLE
	
infinite:
	lbu	$t0, d_puzzle_pending	# will be set in kernel mode when puzzle interrupt occurs
	beq	$t0, $zero, m_no_puzzle
	
	lw	$t0, TIMER
	sub	$a0, $t0, $s0		# find how long it took to get the puzzle
	li	$v0, PRINT_INT
	syscall
	li	$a0, '\n'
	li	$v0, PRINT_CHAR
	syscall
	
	sb	$zero, d_puzzle_pending
	lw	$s0, TIMER
	la	$a0, puzzle
	jal	puzzle_bolt
	
	lw	$t0, TIMER
	sub	$a0, $t0, $s0		# find how long it took to solve the puzzle
	li	$v0, PRINT_INT
	syscall
	li	$a0, '\n'
	li	$v0, PRINT_CHAR
	syscall
	syscall
	
	la	$t0, puzzle
	sw	$t0, SUBMIT_SOLUTION
	
	lw	$s0, TIMER
	sw	$t0, REQUEST_PUZZLE	# get another puzzle
	
m_no_puzzle:
	j	infinite
	
# -----------------------------------------------------------------------
# optimized puzzle solving function
# -----------------------------------------------------------------------

.globl puzzle_bolt
puzzle_bolt:
        sub     $sp, $sp, 44	# free up registers to store:
        sw      $ra, 0($sp)
        sw      $s0, 4($sp)	# scanStart
        sw      $s1, 8($sp)	# marker
        sw      $s2, 12($sp)	# Puzzle.Bitmap.Length
        sw      $s3, 16($sp)	# base address of the bitmap
	sw      $s4, 20($sp)	# qStart
	sw      $s5, 24($sp)	# qEnd
	sw      $s6, 28($sp)	# Puzzle.BytesWidth
	sw      $s7, 32($sp)	# how many bitmap bytes per row are valid
	sw      $gp, 36($sp)
	sw      $fp, 40($sp)
	
	li	$s0, 0		# scanStart = 0
	li	$s1, 'A'	# marker
	li	$s6, 5		# always 5 bytes - documentation is a lie
	
	lw	$t0, 4($a0)	# width
	and	$t1, $t0, 7	# width & 0x7
	srl	$s7, $t0, 3	# floor(width / 8)
	beq	$t1, $zero, pb_no_ceil_needed
	add	$s7, $s7, 1	# ceil(width / 8)
pb_no_ceil_needed:
	lw	$t1, 0($a0)	# height
	mul	$s2, $s6, $t1	# Puzzle.Bitmap.Length
	mul	$s3, $t0, $t1	# width * height
	add	$s3, $a0, $s3	# &puzzle->bitmap - 8
	add	$s3, $s3, 8	# &puzzle->bitmap
	
pb_outer_loop_top:
	beq	$s0, $s2, pb_outer_loop_done
	
	add	$t0, $s3, $s0	# &puzzle->bitmap[scanStart]
	lbu	$t0, 0($t0)	# chunk = puzzle->bitmap[scanStart]
	bne	$t0, $zero, pb_start_fill
	add	$s0, $s0, 1	# scanStart++
	j	pb_outer_loop_top
	
pb_start_fill:
	la	$t0, puzzle_contact	# zero out the contact array
	add	$t1, $t0, 200
pb_clear_contact_top:
	beq	$t0, $t1, pb_clear_contact_done
	sw	$zero, 0($t0)
	sw	$zero, 4($t0)
	sw	$zero, 8($t0)
	sw	$zero, 12($t0)
	sw	$zero, 16($t0)
	add	$t0, $t0, 20		# zero 5 words (20 bytes) per iteration
	j	pb_clear_contact_top
	
pb_clear_contact_done:
	la	$s4, puzzle_queue	# qStart = 0
	add	$s5, $s4, 1		# qEnd = 1
	sb	$s0, 0($s4)		# queue[0] = scanStart
	
pb_fill_loop_top:
	beq	$s4, $s5, pb_fill_loop_done
	lbu	$t5, 0($s4)	# position = queue[qStart]
	add	$t4, $s3, $t5	# &puzzle->bitmap[position]
	lbu	$t6, 0($t4)	# chunk = puzzle->bitmap[position]
	beq	$t6, $zero, pb_fill_loop_next
	
	la	$t9, puzzle_contact
	add	$t0, $t9, $t5	# &contact[position]
	lbu	$t0, 0($t0)	# touching = contact[position]
	sll	$t1, $t6, 8	# chunk << 8
	or	$t1, $t1, $t0	# lookupId = chunk << 8 | touching	
	la	$t0, puzzle_transition
	add	$t0, $t0, $t1	# &transitions[lookupId]
	lbu	$t0, 0($t0)	# transitions[lookupId]
	sb	$t0, 0($t4)	# puzzle->bitmap[position] = transitions[lookupId]
	nor	$t0, $t0, $t0	# ~transitions[lookupId]
	and	$t3, $t0, $t6	# changed = chunk & ~transitions[lookupId]
	beq	$t3, $zero, pb_fill_loop_next
	
	div	$t5, $s6	# need both quotient and remainder
	mfhi	$t7		# position % Puzzle.BytesWidth
	bge	$t7, $s7, pb_fill_loop_next
	mflo	$t8		# position / Puzzle.BytesWidth
	sll	$t7, $t7, 3	# (position % Puzzle.BytesWidth) * 8
	lw	$t0, 4($a0)	# width
	mul	$t8, $t8, $t0	# (position / Puzzle.BytesWidth) * Puzzle.Width
	add	$t7, $t7, $t8	# mapPos
	
	la	$a1, puzzle_touch_vert
	add	$a1, $a1, $t1	# &touchVert[lookupId]
	lbu	$a1, 0($a1)	# touchVert[lookupId]
	la	$a2, puzzle_touch_left
	add	$a2, $a2, $t1	# &touchLeft[lookupId]
	lbu	$a2, 0($a2)	# touchLeft[lookupId]
	la	$a3, puzzle_touch_right
	add	$a3, $a3, $t1	# &touchRight[lookupId]
	lbu	$a3, 0($a3)	# touchRight[lookupId]
	
	add	$t1, $a0, $t7	# &puzzle->map[mapPos] - 8
	li	$t0, 0x80
pb_write_map_top:
	beq	$t3, $zero, pb_write_map_done
	blt	$t3, $t0, pb_write_map_next
	sb	$s1, 8($t1)	# puzzle->map[mapPos] = marker
pb_write_map_next:
	sll	$t3, $t3, 1	# changed <<= 1
	and	$t3, $t3, 0xff	# changed &= 0xff
	add	$t1, $t1, 1
	j	pb_write_map_top
	
pb_write_map_done:
	sub	$t1, $t5, $s6	# upPos = position - puzzle.BytesWidth
	blt	$t1, $zero, pb_no_up
	add	$t0, $s3, $t1	# &puzzle->bitmap[upPos]
	lbu	$t0, 0($t0)	# puzzle->bitmap[upPos]
	beq	$t0, $zero, pb_no_up
	add	$t0, $t9, $t1	# &contact[upPos]
	lbu	$t3, 0($t0)	# contact[upPos]
	or	$t3, $t3, $a1	# contact[upPos] | touchVert[lookupId]
	sb	$t3, 0($t0)
	sb	$t1, 0($s5)	# queue[qEnd] = upPos
	add	$s5, $s5, 1	# qEnd++
	
pb_no_up:
	add	$t8, $t5, $s6	# downPos = position + puzzle.BytesWidth
	bge	$t8, $s2, pb_no_down
	add	$t0, $s3, $t8	# &puzzle->bitmap[downPos]
	lbu	$t0, 0($t0)	# puzzle->bitmap[downPos]
	beq	$t0, $zero, pb_no_down
	add	$t0, $t9, $t8	# &contact[downPos]
	lbu	$t3, 0($t0)	# contact[downPos]
	or	$t3, $t3, $a1	# contact[downPos] | touchVert[lookupId]
	sb	$t3, 0($t0)
	sb	$t8, 0($s5)	# queue[qEnd] = downPos
	add	$s5, $s5, 1	# qEnd++

pb_no_down:
	
pb_fill_loop_next:
	add	$s4, $s4, 1	# qStart++
	j	pb_fill_loop_top
	
pb_fill_loop_done:
	add	$s1, $s1, 1	# marker++
	j	pb_outer_loop_top
	
pb_outer_loop_done:
        lw      $ra, 0($sp)
        lw      $s0, 4($sp)
        lw      $s1, 8($sp)
        lw      $s2, 12($sp)
        lw      $s3, 16($sp)
	lw      $s4, 20($sp)
	lw      $s5, 24($sp)
	lw      $s6, 28($sp)
	lw      $s7, 32($sp)
	lw      $gp, 36($sp)
	lw      $fp, 40($sp)
	add     $sp, $sp, 44
	jr	$ra


# print board ##################################################
#
# argument $a0: board to print
.globl print_board
print_board:
    sub         $sp, $sp, 20
    sw          $ra, 0($sp)     # save $ra and free up 4 $s registers for
    sw          $s0, 4($sp)     # i
    sw          $s1, 8($sp)     # j
    sw          $s2, 12($sp)    # the address
    sw          $s3, 16($sp)    # the line number
    move        $s2, $a0
    li          $s0, 0          # i
pb_loop1:
    li          $s1, 0          # j
pb_loop2:

    lw          $t0, 0($s2)     # NUM_ROWS
    lw          $t1, 4($s2)     # NUM_COLS

    mul         $t2, $s0, $t1   # i * NUM_COLS
    add         $t2, $t2, $s1   # i * NUM_COLS + j
    add         $t2, $t2, 8
    add         $t2, $t2, $s2


    lb          $a0, 0($t2)     # num = &board[i][j]
    li          $v0, 11
    syscall
    j           pb_cont
pb_cont:
    add         $s1, $s1, 1     # j++
    blt         $s1, 8, pb_loop2
    li          $v0, 11         # at the end of a line, print a newline char.
    li          $a0, '\n'
    syscall

    add         $s0, $s0, 1     # i++
    blt         $s0, 8, pb_loop1
    lw          $ra, 0($sp)     # restore registers and return
    lw          $s0, 4($sp)
    lw          $s1, 8($sp)
    lw          $s2, 12($sp)
    lw          $s3, 16($sp)
    add         $sp, $sp, 20
    jr          $ra

# -----------------------------------------------------------------------
# sb_arctan - computes the arctangent of y / x
# $a0 - x
# $a1 - y
# returns the arctangent in $v0
# -----------------------------------------------------------------------
sb_arctan:
        li          $v0, 0           # angle = 0;

        abs         $t0, $a0         # get absolute values
        abs         $t1, $a1
        ble         $t1, $t0, no_TURN_90

        ## if (abs(y) > abs(x)) { rotate 90 degrees }
        move        $t0, $a1         # int temp = y;
        neg         $a1, $a0         # y = -x;
        move        $a0, $t0         # x = temp;
        li          $v0, 90          # angle = 90;

no_TURN_90:
        bgez        $a0, pos_x       # skip if (x >= 0)

        ## if (x < 0)
        add         $v0, $v0, 180    # angle += 180;

pos_x:
        mtc1        $a0, $f0
        mtc1        $a1, $f1
        cvt.s.w     $f0, $f0         # convert from ints to floats
        cvt.s.w     $f1, $f1

        div.s       $f0, $f1, $f0    # float v = (float) y / (float) x;
    
        mul.s       $f1, $f0, $f0    # v^^2
        mul.s       $f2, $f1, $f0    # v^^3
        l.s         $f3, three       # load 3.0
        div.s       $f3, $f2, $f3    # v^^3/3
        sub.s       $f6, $f0, $f3    # v - v^^3/3

        mul.s       $f4, $f1, $f2    # v^^5
        l.s         $f5, five        # load 5.0
        div.s       $f5, $f4, $f5    # v^^5/5
        add.s       $f6, $f6, $f5    # value = v - v^^3/3 + v^^5/5

        l.s         $f8, PI          # load PI
        div.s       $f6, $f6, $f8    # value / PI
        l.s         $f7, F180        # load 180.0
        mul.s       $f6, $f6, $f7    # 180.0 * value / PI

        cvt.w.s     $f6, $f6         # convert "delta" back to integer
        mfc1        $t0, $f6
        add         $v0, $v0, $t0    # angle += delta

        bge         $v0, 0, sb_arc_tan_end
        # negative value received.
        li          $t0, 360
        add         $v0, $t0, $v0

sb_arc_tan_end:
        jr          $ra

.kdata
chunkIH:            .space 32
non_intrpt_str:     .asciiz "Non-interrupt exception\n"
unhandled_str:      .asciiz "Unhandled interrupt type\n"
.ktext 0x80000180
interrupt_handler:
.set noat
        move        $k1, $at        # Save $at
.set at
        la          $k0, chunkIH
        sw          $a0, 0($k0)        # Get some free registers
        sw          $v0, 4($k0)        # by storing them to a global variable
        sw          $t0, 8($k0)
        sw          $t1, 12($k0)
        sw          $t2, 16($k0)
        sw          $t3, 20($k0)
	sw          $t4, 24($k0)
	sw          $t5, 28($k0)

        mfc0        $k0, $13             # Get Cause register
        srl         $a0, $k0, 2
        and         $a0, $a0, 0xf        # ExcCode field
        bne         $a0, 0, non_intrpt



interrupt_dispatch:            # Interrupt:
        mfc0        $k0, $13        # Get Cause register, again
        beq         $k0, 0, done        # handled all outstanding interrupts

        and         $a0, $k0, BONK_INT_MASK    # is there a bonk interrupt?
        bne         $a0, 0, bonk_interrupt

        and         $a0, $k0, TIMER_INT_MASK    # is there a timer interrupt?
        bne         $a0, 0, timer_interrupt

        and 	    $a0, $k0, REQUEST_PUZZLE_INT_MASK
        bne 	    $a0, 0, request_puzzle_interrupt

        li          $v0, PRINT_STRING    # Unhandled interrupt types
        la          $a0, unhandled_str
        syscall
        j           done

bonk_interrupt:
	sw 	    $0, BONK_ACK
        #Fill in your code here
        j           interrupt_dispatch    # see if other interrupts are waiting

request_puzzle_interrupt:
	sw	$0, REQUEST_PUZZLE_ACK
	li	$t0, 1
	sb	$t0, d_puzzle_pending
	j	interrupt_dispatch

timer_interrupt:
	sw 	    $0, TIMER_ACK
	#Fill in your code here
        j           interrupt_dispatch    # see if other interrupts are waiting

non_intrpt:                # was some non-interrupt
        li          $v0, PRINT_STRING
        la          $a0, non_intrpt_str
        syscall                # print out an error message
        # fall through to done

done:
        la          $k0, chunkIH
        lw          $a0, 0($k0)        # Restore saved registers
        lw          $v0, 4($k0)
        lw          $t0, 8($k0)
        lw          $t1, 12($k0)
        lw          $t2, 16($k0)
        lw          $t3, 20($k0)
        lw          $t4, 24($k0)
        lw          $t5, 28($k0)
.set noat
        move        $at, $k1        # Restore $at
.set at
        eret
